import React from 'react';
import './tab-control.css';

const TabControl = ({data}) => {
    const links = data.map((key, index) => {

        let classNames = 'list-group-item';
        if(document.URL.indexOf(key)> -1 )  classNames += ' active';

        return (
            <li className={classNames} key={key} >
                <Link to={`/${key}`}> {key} </Link>
            </li>
        );

      });
  return (
    <div><ul className="tab d-flex">{links}</ul></div>
  );
};

export default TabControl;
